import React,{useEffect} from 'react';
import {getGithubRepos} from '../../actions/profile'
import { useDispatch,useSelector} from 'react-redux';

const ProfileGithub = () => {
    const {username, getGithubRepos,repos}=useSelector(state=>state.profile.repos)
    const dispatch=useDispatch();
    useEffect(()=>{
        dispatch(getGithubRepos(username))
    },[getGithubRepos,username])
  return (
      <Fragment>
        <div class="profile-github">
        <h2 class="text-primary my-1">
            <i class="fab fa-github"></i> Github Repos
        </h2>
         <div class="repo bg-white p-1 my-1">
            <div>
                <h4><a href="#" target="_blank"
                rel="noopener noreferrer">Repo One</a></h4>
                <p>
                    Lorem ipsum dolor sit amet consectetur adipisicing elit.
                    Repellat, laborum!
                </p>
            </div>
         <div>
            <ul>
            <li class="badge badge-primary">Stars: 44</li>
            <li class="badge badge-dark">Watchers: 21</li>
            <li class="badge badge-light">Forks: 25</li>
            </ul>
        </div>
        </div>
       </div>
    </Fragment>

  );
};

export default ProfileGithub;
